import React from 'react';
import './Navbar.css'; // Ensure this path matches your setup

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="navbar-container">
        <a href="/" className="navbar-logo"><i className="fa fa-dollar-sign"></i>Expense Tracker</a>
        <div className="navbar-links">
          <a href="/" className="navbar-link">      <i className="fa fa-home"></i>          Home</a>
          <a href="/login" className="navbar-link"><i className="fa fa-sign-in-alt"></i>Login/Register</a>
    
      
          <a href="/about" className="navbar-link"><i className="fa fa-info-circle"></i>About</a> {/* Add About link */}
          <a href="/contact" className="navbar-link"><i className="fa fa-envelope"></i> Contact</a>
      
        </div>
      </div>
    </div>
  );
};

export default Navbar;
